import React from "react";
import { Link } from "react-router-dom";
import './Paged.css';



export default function Paged({ pokePerPage, pokemons, paged, currentPage }) {
  let pagedNumbers = [];
  for (let i = 1; i <= Math.ceil(pokemons / pokePerPage); i++) {
    pagedNumbers.push(i)
  }

  return (
    <div className="paged">
      <div className="lista">
        <Link to='/'>
          <button>Landing</button>
        </Link>
        <button onClick={ currentPage > 1 ? () => paged(currentPage - 1) : null}
        disabled={currentPage === 1 ? true : false}>ðŸ¢¢</button>
        {pagedNumbers && pagedNumbers.map((number, i) => (
          <div className="anchor">
            <p className="anchor" key={i} onClick={() => paged(number)}>{number}</p>
          </div>
        ))}
        <button onClick={ currentPage < 12 ? () => paged(currentPage + 1) : null}
        disabled={currentPage === 12 ? true : false}>ðŸ¢£</button>
      </div>
    </div>

  )
}
